window.bookSummaryJSON = "<p><b>The Stormriders approach, certain to leave death and destruction in their wake. Can one young man find a way to defeat them?</b></p> <p>Ten years after his father’s death, the memory of the attack still haunts 19-year-old Ary. On the eve of the draft, he faces his greatest fear: being sent to join the marines.&nbsp;</p> <p>He knows the cost of war.</p> <p>Ary dreams of marrying his childhood sweetheart, building a farm, and starting a family. But the Stormriders threat of war puts his loved ones and his plans in jeopardy.</p> <p>Wishing for peace won’t make it true.</p> <p>For love, for his people, and for the life he desires, Ary makes a decision that will change everything. Thus begins<i> </i>The Storm Below.</p> <p>This bundle contains the complete Storm Below Saga - that's five audiobooks of epic fantasy! Listen to:</p> <p></p> <ol> <li><i>Above the Storm</i></li> <li><i>Reavers of the Tempest</i></li> <li><i>Storm of Tears </i></li> <li><i>Golden Darkness Descends</i></li> <li><i>Shattered Sunlight</i></li> </ol> <p><b>The Storm Below is a beautifully creative fantasy epic. Action-packed, dark, and intense, this fantasy series features characters you are certain to love...and others you will love to hate. </b></p> <p><b>Download the complete bundle today!</b></p>"; 
